package com.softserve.edu.service.parser;

import com.softserve.edu.device.test.data.DeviceTestData;
import org.junit.After;
import org.junit.Before;
import org.junit.Test;
import java.io.BufferedInputStream;
import java.io.FileInputStream;
import java.io.InputStream;
import static org.junit.Assert.*;
import static org.junit.Assert.assertTrue;


public class BbiDeviceTestDataParserTest {
    private InputStream file;
    private DeviceTestData deviceTestData;
    private BbiDeviceTestDataParser bbiDeviceTestDataParser;

    @Before
    public void setUp() throws Exception {
        bbiDeviceTestDataParser = new BbiDeviceTestDataParser();
        file = new BufferedInputStream(new FileInputStream("15101400.bbi"));
    }

    @After
    public void tearDown() throws Exception {
        bbiDeviceTestDataParser = null;
        deviceTestData = null;
        file = null;
    }

    @Test
    public void testParse() throws Exception {
        deviceTestData = bbiDeviceTestDataParser.parse(file);
        assertEquals("fileName",deviceTestData.getFileName(),"15101400.bbi");
        assertTrue("year not correct",deviceTestData.getYear() == 2014);
        assertTrue("test1terminalCounterValue not correct", deviceTestData.getTestTerminalCounterValue(1) == 779.75);
        assertTrue("month not correct",deviceTestData.getMonth() == 10);
        assertEquals("testPhoto not correct", deviceTestData.getTestPhoto(),"");
        assertTrue("test1allowableError not correct", deviceTestData.getTestAllowableError(1) == 4);
        assertTrue("test1testNumber not correct", deviceTestData.getTestNumber(1) == 10);
        assertTrue("test1testDuration not correct", deviceTestData.getTestDuration(1)==48.434);
        assertTrue("test1unixTestEndTime not correct", deviceTestData.getTestUnixEndTime(1) == 1413381531);
        assertTrue("impulsePricePerLitre not correct", deviceTestData.getImpulsePricePerLitre() == 10000);
        assertTrue("test1estimatedError not correct", deviceTestData.getTestDuration(1)==48.434);
        assertTrue("test1unixTestEndTime not correct", deviceTestData.getTestEstimatedError(1) == 299);
        assertTrue("latitude not correct", deviceTestData.getLatitude() == 50.52672);
        assertTrue("test1correctionFactor not correct", deviceTestData.getTestCorrectionFactor(1) == 9717000);
        assertTrue("dayOfWeek not correct", deviceTestData.getDayOfWeek() == 3);
        assertEquals("test1beginPhoto not correct", deviceTestData.getBeginPhoto(1),"");
        assertTrue("temperature not correct", deviceTestData.getTemperature() == 0);
        assertTrue("test1lowerConsumptionLimit not correct", deviceTestData.getTestLowerConsumptionLimit(1) == 80);
        assertTrue("test1unixTestBeginTime not correct", deviceTestData.getTestUnixBeginTime(1) == 1413381483);
        assertTrue("test1minConsumptionLimit not correct", deviceTestData.getTestMinConsumptionLimit(1) == 0);
        assertTrue("test1specifiedConsumption not correct", deviceTestData.getTestSpecifiedConsumption(1) == 4167);
        assertEquals("test1endPhoto not correct", deviceTestData.getEndPhoto(1),"");
        assertTrue("test1correctedCurrentConsumption not correct", deviceTestData.getTestCorrectedCurrentConsumption(1) == 11.5);
        assertTrue("test1currentConsumptionWithoutCorrection not correct", deviceTestData.getTestCurrentConsumptionWithoutCorrection(1) == 11.5);
        assertTrue("second not correct", deviceTestData.getSecond() == 16);
        assertTrue("minute not correct", deviceTestData.getMinute() == 9);
          }
}